import React, { Component } from 'react';

export class searchBar extends Component {
    render() {
        return (
            <form style={{ display: 'flex' }}>
                <input
                    type="test"
                    name="title"
                    style={{flex: 10}}
                    placeholder="Add Ingredient"
                    />
                    <input
                        type="submit"
                        value="Submit"
                        className="btn"
                        style={{flex: 1}}
                    />
            </form>
        )
    }
}

export default searchBar
